import React, { useState } from "react";

const Signup = () => {
  const [email, setemail] = useState();
  //   const [name, setname] = useState();
  //   const [password, setpassword] = useState();
  //   const [confirmpassword, setconfirmpassword] = useState();
  //   const [pic, setpic] = useState();

  return (
    <form class="form-floating row g-3 needs-validation" novalidate>
      <div class="mb-3">
        <label
          for="floatingInputValue"
          class="form-label"
          style={{ width: "50%" }}
        >
          Email address
        </label>
        <input
          type="email"
          class="form-control StanderdizedBox"
          id="emailinputarea"
          style={{ width: "75%" }}
          placeholder="name@example.com"
          onChange={(e) => setemail(e.target.value)}
          required
        ></input>
        <div class="invalid-feedback">Need email</div>
      </div>
      <div class="mb-3"></div>
    </form>
  );
};

export default Signup;
